import React from 'react';
import styles from './styles/PieChart.module.css';

export const FloorStatus = ({ value }) => {
  const circumference = 2 * Math.PI * 70;
  const strokeDashoffset = circumference - (value / 100) * circumference;

  return (
    <div className={styles.pieChartContainer}>
      <h3>Floor status</h3>
      <div className={styles.pieChart}>
        <svg viewBox="0 0 160 160" width="160" height="160">
          <circle
            cx="80"
            cy="80"
            r="70"
            fill="none"
            stroke="#eef0f2"
            strokeWidth="20"
          />
          <circle
            cx="80"
            cy="80"
            r="70"
            fill="none"
            stroke="#1366d9"
            strokeWidth="20"
            strokeDasharray={circumference}
            strokeDashoffset={strokeDashoffset}
            transform="rotate(-90 80 80)"
          />
          <text x="80" y="80" textAnchor="middle" dy=".3em" className={styles.percentage}>
            {value}%
          </text>
        </svg>
      </div>
      <div className={styles.legend}>
        <div className={styles.legendItem}>
          <div className={styles.legendDot} style={{ backgroundColor: '#1366d9' }} />
          <span>Completed</span>
        </div>
        <div className={styles.legendItem}>
          <div className={styles.legendDot} style={{ backgroundColor: '#eef0f2' }} />
          <span>Yet to Complete</span>
        </div>
      </div>
    </div>
  );
};
